const React = require('react')
const ReactDOM = require('react-dom')

class Equipo extends React.Component {
    constructor(props) {
        super(props)
    }

    render() {
        return (
            <div>
                {this.props.nombre}
                {this.props.dt}
            </div>
        )
    }
}
